Speed up MongoDB Query Response | Discord Bot<p>I didn't think this would be an issue, but as the database I am using continues to grow, I've noticed that the responses from my program are getting slower and slower (which makes sense, more stuff to look through to return).</p>
<p>Now my question is how would I be able to speed up the performance of my response because it takes quite some time to do the following as of right now:
I want to sort and return to the top 10 results from a query search, currently, my code looks something along the lines of:</p>
<pre><code>alldocuments = self.bot.db.nameofdb.find()
alldocuments = list(map(lambda x: x[&quot;userId&quot;], alldocuments ))
_documentCount = [(i, alldocuments.count(i)) for i in set(alldocuments)]
_documentCount.sort(key = lambda x: x[1], reverse=True)
docCount = list(filter(lambda x: ctx.guild.get_member(int(x[0])), _documentCount))


i = 0
while i &lt; 10:
     if not ctx.guild.get_member(int(docCount[i][0])):
          i+=1
          continue
     print(docCount[i][1]})
     i += 1
</code></pre>
<p>Some information:</p>
<p>Database consists of thousands of entries as follow:</p>
<pre><code>Entry Ex. 1:
{
_id: 62338b6994b3773415bd7efc
uid: &quot;849551661&quot;
