rank_type: &quot;3&quot;
id: &quot;1640423160000228061&quot;
userId: 738362958253522976
}

Entry Ex. 2
{

_id: 62338b6994b3773415bd7efe
uid: &quot;849551661&quot;
gacha_type: 100
item_id: &quot;&quot;
count: &quot;1&quot;
time: &quot;2021-12-25 17:42:58&quot;
name: &quot;Noelle&quot;
lang: &quot;en-us&quot;
item_type: &quot;Character&quot;
rank_type: &quot;4&quot;
id: &quot;1640423160000227861&quot;
userId: 738362958253522976

}
</code></pre>
<p>Now my database currently exists with over 100k of these entries, and I want to sort them by userId in the order of which &quot;userId&quot; has the greatest amount of entries.</p>
<p>A sample result should be something along the lines of:</p>
<pre><code>1. 25k - userId
2. 15k - userId
