Can Mongo Bulk Operations like insertMany Partially Fail?<p>After scouring the documentation and posts online, there is one thing I have never been clear about with Mongo.</p>
<p>When you are attempting to write documents in bulk to a collection like the example below, is it ever possible that you would get <strong>some</strong> documents that write successfully, but some that don't?</p>
<pre><code>db.products.insertMany( [
  { item: &quot;card&quot;, qty: 15 },
  { item: &quot;envelope&quot;, qty: 20 },
  { item: &quot;stamps&quot; , qty: 30 }
] );
</code></pre>
<p>In other words, could you ever get into a situation where you would create documents for the <em>card</em> and <em>envelope</em> items, but <strong>not</strong> for the <em>stamps</em> item?</p>
<p>I am trying to improve the performance of some of my company's processes and there is some debate in my team as to what kind of error scenarios can really arise from bulk inserts or updates, so if anyone has a clear answer, that would be fantastic. I know that generally mongo queries are not transactional unless you explicitly state so, but this is one area where it just wasn't clear.</p>

